define({"topics" : [{"title":"Add an Outbound Route","shortdesc":"\n                  <p class=\"shortdesc\">To allow users make outbound calls through trunks, you need to set up at least an         outbound route on the PBX.</p>\n               ","id":"task_az3_dht_tcb","href":"topic\/add_outbound_route.html","menu": {"hasChildren":false,},"tocID":"task_az3_dht_tcb-d46e8899","topics":[]},{"title":"Adjust Priority of Outbound Routes","shortdesc":"\n                  <p class=\"shortdesc\">The PBX will search for a matching dial pattern from the top route. If a route with         higher priority is matched, the\n                     PBX will not continue going down the route list to search a         \"better\" route.\n                  </p>\n               ","id":"task_bcf_1n5_tcb","href":"topic\/adjust_priority_of_outbound_routes.html","menu": {"hasChildren":false,},"tocID":"task_bcf_1n5_tcb-d46e8972","topics":[]},{"title":"Dial Patterns of Outbound Route","shortdesc":"\n                  <p class=\"shortdesc\">To make an outbound calls from the PBX, users need to dial according to dial pattern         settings of the outbound routes.</p>\n               ","id":"concept_y3j_ns1_ydb","href":"topic\/dial_patterns_of_outbound_route.html","menu": {"hasChildren":false,},"tocID":"concept_y3j_ns1_ydb-d46e9045","topics":[]},{"title":"Outbound Route Examples","shortdesc":"\n                  <p class=\"shortdesc\">Sample configurations that will help you understand outbound route dial patterns. </p>\n               ","id":"topic_ufc_lr5_tcb","href":"topic\/outbound_route_examples.html","menu": {"hasChildren":false,},"tocID":"topic_ufc_lr5_tcb-d46e9118","topics":[]},{"title":"Restrict Outbound Calls","shortdesc":"\n                  <p class=\"shortdesc\">The PBX has a default rule to limit how many outbound calls a user can make during a         certain time period.</p>\n               ","id":"task_fr4_nrt_tcb","href":"topic\/restrict_outbound_calls.html","menu": {"hasChildren":false,},"tocID":"task_fr4_nrt_tcb-d46e9191","topics":[]},{"title":"Add Emergency Numbers","shortdesc":"\n                  <p class=\"shortdesc\">Emergency calls have the highest priority. Extension users can make emergency calls         at any time.</p>\n               ","id":"task_om5_xw5_tcb","href":"topic\/add_emergency_calls.html","menu": {"hasChildren":false,},"tocID":"task_om5_xw5_tcb-d46e9264","topics":[]}]});